import logo from './logo.svg';
import './App.css';
import 'bootstrap/dist/css/bootstrap.css'
import {Nav, Navbar, NavBar, NavDropdown} from 'react-bootstrap'
import Home from "./pages/Home"
import Algo2 from "./pages/Algo2"
import Bfa from "./pages/Bfa"
import Opkut from "./pages/Opkut"
import Login from "./pages/Login"

function App() {
  let Component
  switch (window.location.pathname) {
    case "/home":Component= <Home />
      break;
    case "/algo2":Component = <Algo2 />
      break
    case "/opkut":Component = <Opkut />
      break
    case "/bfa":Component = <Bfa />
      break
    case "/login":Component = <Login />
      break
  }
  return (
    <>
      <Navbar />
      <div className="container">{Component}</div>
    </>
  );
}

export default App;
